    Paypal_payment_not_completed_explained: "Alasan pembayaran Paypal masih belum dipenuhi:<br><b>echeck</b>: Pembayaran masih ditunda karena masih dilakukan eCheck yang belum selesai sepenuhnya.<br><b>intl</b>: Pembayaran masih ditunda karena seller memegang akun non-U.S dan tidak memiliki mekanisme penarikan. Seller harus secara manual menerima atau menolak pembayaran ini.<br><b>multi-currency</b>: Seller tidak memiliki balance pada currency yang dikirimkan. Seller harus dengan manual menerima atau menolak pembayaran ini.<br><b>unilateral</b>: Pembayaran masih ditunda karena dilakukan email address yang belum diregistrasi atau dikonfirmasikan.<br><b>upgrade</b>: Pembayaran ditunda karena dilakukan melalui kartu credit dan seller harus upgrade aku ini dalam katagori Business atau Premier status agar uangnya dapat diambil. <br><b>verify</b>: Pembayaran ditundak karena seller belum diverifikasi. Seller harus melakukan verifikasi akunnya sebelum dia dapat melakukan pembayaran.<br><b>other</b>: Pembayaran ditunda dengan alasan selain yang tersebut diatas. Untuk informasi lebih lanjut, hubungi PayPal Customer Service.<br><b>Denied</b>: Seller menolak pembayaran jenis ini."
